import React, { useState } from 'react'
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import { Typography } from '@mui/material';
import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import ImageListItemBar from "@mui/material/ImageListItemBar";
import door from "../images/Realistic - door.png";
import electrical from "./images/Realistic - electrical.png";
import lover from "./images/lover.png";
import hello from "./images/hello world.png";
import dior from "./images/dior.png";
import diptyque from "./images/diptyque.png";
import dressroom from "./images/dressroom.png";
import pink from "./images/pink.png";

export default function Design() {
    let [like, likechange] = useState(0);
    const itemData = [
        {
          img: door,
          title: "door",
          author: "Sunlit day at 227",
        },
        {
          img: electrical,
          title: "electrical",
          author: "You left the power on",
        },
        {
          img: lover,
          title: "lover",
          author: "Lovers are stronger than haters",
        },
        {
          img: hello,
          title: "hello world",
          author: "My coding habits are coming out in 3D",
        },
        {
          img: dior,
          title: "dior",
          author: "The perfume on my mom's vanity",
        },
        {
          img: diptyque,
          title: "diptyque",
          author: "Untitled",
        },
        {
          img: dressroom,
          title: "dressroom",
          author: "Plastic perfume bottle",
        },
        {
          img: pink,
          title: "pink",
          author: "Shadows in pink",
        },
      ];
  return (
    <div>
      <Box
            ml={18}
            sx={{
              bgcolor: "#b5b5b5",
              borderRadius: 2,
              width: 1390,
              height: 250,
            }}
          >
            <div class="container">
              <div class="circle1"></div>
              <div class="circle2"></div>
              <div class="circle3"></div>
            </div>

              <Paper
                elevation={5}
                sx={{
                  bgcolor: "white",
                  borderRadius: 1,
                  width: 1390,
                  height: 845,
                  fontSize: 24,
                }}
              >
                <br />
                <Typography variant="h2">
                  {" "}
                  My Creations{" "}
                  <span
                    onClick={() => {
                      likechange(like + 1);
                    }}
                  >
                    {" "}
                    ❤️{" "}
                  </span>{" "}
                  {like}{" "}
                </Typography>
                <ImageList variant="masonry" cols={4} gap={7}>
                  {itemData.map((item) => (
                    <ImageListItem
                      sx={{ width: 300, height: 450, mr: "15px", ml: "15px" }}
                      key={item.img}
                    >
                      <img
                        src={`${item.img}?w=248&fit=crop&auto=format`}
                        srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
                        alt={item.title}
                        loading="lazy"
                      />
                      <ImageListItemBar position="below" title={item.author} />
                    </ImageListItem>
                  ))}
                </ImageList>
              </Paper>
          </Box>
    </div>
  )
}
